import React from "react";

const ListTodo = () => {
  return (
    <div>
      <h1>Todo List</h1>
      <table class="table mt-5 text-center">
        <thead>
          <tr>
            <th>Description</th>
            <th>Edit</th>
            <th>Delete</th>
          </tr>
        </thead>
        <tbody></tbody>
      </table>
    </div>
  );
};

export default ListTodo;
